    List<Counter> articleModel;
    Privilege privi = new Privilege();
    //GetSessionInfo
    long CompanyId;
    long RoleId;
    string strMenu = "Counter";
    bool strAdd = true;
    bool strEdit = true;
    bool strDelete = true;
    bool strShow = true;
    protected async override void OnInitialized()
    {
        CompanyId = await sessionStorage.GetItemAsync<long>("CompanyId");
        RoleId = await sessionStorage.GetItemAsync<long>("RoleId");
        LoadData();
        StateHasChanged();
    }
    protected void LoadData()
    {
        //CheckPriviliage
        privi = priviliageRepository.PriviliageCheck(strMenu, RoleId, CompanyId);
        if (privi != null)
        {
            strAdd = privi.AddAction;
            strEdit = privi.EditAction;
            strDelete = privi.DeleteAction;
            strShow = privi.ShowAction;
            if (strShow == false)
            {
                Toaster.Add("You dont have to privilege.", MatToastType.Success, "dashboard", null);
                navManager.NavigateTo("dashboard");
            }
        }
        else
        {
            strAdd = true;
            strEdit = true;
            strDelete = true;
            strShow = true;
        }
        articleModel = counterRepository.ViewAllCounter();
    }
    async Task Delete(long id)
    {
        if (strDelete == true)
        {
            bool confirmed = await JsRuntime.InvokeAsync<bool>("confirm", "Are you sure?");
            if (confirmed)
            {
                if (id != 1)
                {
                    bool isSave = false;
                    isSave = counterRepository.DeleteCounter(id);
                    if (isSave == true)
                    {
                        Toaster.Add("Delete Successfully.", MatToastType.Info, "Counter List", null);
                        navManager.NavigateTo("counterlist");
                    }
                    else
                    {
                        Toaster.Add("Cannot be delete. already in used.", MatToastType.Warning, "Counter List", null);
                        navManager.NavigateTo("counterlist");
                    }
                }
